import React from 'react';
import './App.css';
import Hobbies from "./components/Hobbies"

function App() {


  return (
    <div className="App">
      <Hobbies name="Tennis" pic="https://photoresources.wtatennis.com/photo-resources/2019/08/15/dbb59626-9254-4426-915e-57397b6d6635/tennis-origins-e1444901660593.jpg?width=1200&height=630" details="Tennis is a racket sport that can be played individually against a single opponent (singles) or between two teams of two players each (doubles). Each player uses a tennis racket that is strung with cord to strike a hollow rubber ball covered with felt over or around a net and into the opponent's court. The object of the game is to maneuver the ball in such a way that the opponent is not able to play a valid return. The player who is unable to return the ball will not gain a point, while the opposite player will."/>
      <Hobbies name="Quilting" pic="https://photoresources.wtatennis.com/photo-resources/2019/08/15/dbb59626-9254-4426-915e-57397b6d6635/tennis-origins-e1444901660593.jpg?width=1200&height=630" details="Quilting is the term given to the process of joining a minimum of three layers of fabric together either through stitching manually by hand using a needle and thread, or mechanically with a sewing machine or specialised longarm quilting system. An array of stitches is passed through all layers of the fabric to create a three dimensional padded surface. The three layers are typically referred to as the top fabric or quilt top, batting or insulating material and the backing."/>

    </div>
  );
}

export default App;
